using Fluffy.Contracts;
using Fluffy.Data;
using Fluffy.Models;

namespace Fluffy.Services
{
    public class CatService : ICatService
    {
        //private FluffyDbContext dbContext = new FluffyDbContext();
        private FluffyDbContext dbContext;
        public CatService(FluffyDbContext dbContext)
        {
            this.dbContext = dbContext;
        }

        public void Add(Cat cat)
        {
            throw new NotImplementedException();
        }

        public List<Cat> GetAll()
        {
            //return new List<Cat>() { new Cat() { Age = 2, Name="Tom", Breed = "Ulichna", URL = @"data:image/jpeg;base64," } };
            return this.dbContext.Cats.ToList();
        }

        public void Create(Cat x)
        {
            this.dbContext.Add(x);

            this.dbContext.SaveChanges();
        }

        public Cat GetCatById(int id)
        {
            var cat = this.dbContext.Cats.Find(id);

            if (cat == null)
            {
                throw new ArgumentException("There is no cat with such id!");
            }

            return cat;
        }
    }
}
